                "sentence":"Originally named the Institute of British Architects in London , it was formed in 1834 by several prominent architects , including Decimus Burton , Philip Hardwick , Thomas Allom , William Donthorne , Thomas Leverton Donaldson , William Adams Nicholson , John Buonarotti Papworth , and Thomas de Grey , 2nd Earl de Grey . After the grant of the royal charter it had become known as the Royal Institute of British Architects in London , eventually dropping the reference to London in 1892 . In 1934 , it moved to its current headquarters on Portland Place , with the building being opened by King George V and Queen Mary . It was granted its Royal Charter in 1837 under King William IV .",
