                "sentence":"Supplemental Charters of 1887 , 1909 and 1925 were replaced by a single Charter in 1971 , and there have been minor amendments since then . The original Charter of 1837 set out the purpose of the Royal Institute to be : ' the general advancement of Civil Architecture , and for promoting and facilitating the acquirement of the knowledge of the various arts and sciences connected therewith ' The operational framework is provided by the Byelaws , which are more frequently updated than the Charter . Any revisions to the Charter or Byelaws require the approval of the Privy Council . The design of the Institute 's Mycenae an lions medal and the Latin motto `` Usui civium , decori urbium '' has been attributed to Thomas Leverton Donaldson , who had been honorary secretary until 1839 .",
